VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'with an Agilent 2100 Bioanalyzer (Agilent Technologies, Shanghai, China) to meet analysis standards. The RNA sample preparation involved purifying mRNA from total RNA using poly-T magnetic beads, fragmenting it with elevated temperatures and divalent cations, synthesizing 1st strand cDNA with random hexamer primers and M-MuLV Reverse Transcriptase, degrading RNA with RNase H, synthesizing 2nd strand cDNA with DNA polymerase I and dNTPs, smoothing DNA fragment ends, adenylating 3′ ends, ligating hairpin loop adaptors, isolating cDNA fragments of 370 to 420 bp via AMPure XP (Beckman Coulter, Beverly), and purifying amplified products to construct the sequencing library. The library, once qualified, was pooled according to effective concentration and desired sequencing volume, then sequenced on the Illumina NovaSeq 6000 platform. This process generated paired-end reads of 150 bp. The data underwent initial quality checks to ensure suitability for downstream analytical processes.', '{-0.7300568222999573,-0.057528913021087646,0.0675731971859932,0.29230010509490967,-0.024707665666937828,0.7797935605049133,-0.8738143444061279,0.14128617942333221,0.665667712688446,0.09241658449172974,-0.5833597183227539,-0.43679705262184143,0.0455588698387146,0.09910731017589569,0.2499842792749405,0.06667472422122955,0.05964422598481178,0.38390693068504333,0.15561580657958984,-0.670174777507782,0.5524619221687317,-0.12938793003559113,0.17128553986549377,-0.2279011458158493,1.070327877998352,-0.22169888019561768,0.1702592968940735,0.384224534034729,-0.19595403969287872,-0.42658793926239014,0.003208890790119767,-0.2699893116950989,0.7419745326042175,0.6902034878730774,-0.6695467829704285,-0.2982054650783539,0.1499544382095337,0.5540579557418823,-0.9994067549705505,0.22857390344142914,0.2865990102291107,-0.07588935643434525,0.04961264505982399,0.7020246982574463,0.2022983878850937,0.11558427661657333,-0.2328663468360901,0.