VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'The data underwent initial quality checks to ensure suitability for downstream analytical processes. The RA datasets ( We compared gene expression between female and male cohorts using our sequencing data. Differential genes were identified using the “limma” R package (version 3.40.6), applying a threshold of |log2 fold change| > 1 and a false discovery rate < 0.05. We visualized the results with volcano plots and heatmaps, employing the “ggplot2” and “pheatmap” R packages, respectively. We used the Kyoto Encyclopedia of Genes and Genomes REST API ( This study employed a dual strategy combining least absolute shrinkage and selection operator (LASSO) regression and support vector machine recursive feature elimination (SVM-RFE) to select gender-associated key genes. In the data preprocessing phase, clinical gender labels were integrated with differential expression data based on sample IDs to construct a standardized expression matrix (Z-score normalization).', '{0.5228370428085327,0.38751697540283203,0.4973570704460144,0.16191045939922333,-0.47260335087776184,-0.1704953908920288,-0.5577486157417297,-0.2125672698020935,-0.7128328084945679,-0.07690484821796417,-0.674114465713501,0.08073744922876358,0.4748021960258484,0.3659391403198242,-0.04898979142308235,-0.03372275084257126,1.6140263080596924,-0.0753098577260971,-0.18388035893440247,-0.11246132105588913,-0.039204053580760956,-0.4013999104499817,-0.34431490302085876,0.14469309151172638,0.2534016966819763,-0.7389909029006958,0.47212496399879456,1.0288958549499512,0.3772098422050476,0.01660011149942875,0.25545650720596313,0.3933272361755371,0.12744687497615814,0.30040836334228516,-0.10270346701145172,-0.2263687252998352,-0.30262377858161926,0.1438356339931488,-0.7612244486808777,-0.035647422075271606,-0.1579003632068634,0.09738026559352875,0.17939041554927826,-0.18419739603996277,-0.33132773637771606,0.08626558631658554,-0.5030555129051208,0.054852