VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'sion data based on sample IDs to construct a standardized expression matrix (Z-score normalization). LASSO regression was implemented using the glmnet package (v4.1-8), with the elastic net parameter set to α = 1 (pure L1 penalty). The regularization path spanned λ = 10⁻⁵ to 10² over 100 logarithmic intervals. Ten-fold stratified cross-validation was used to determine the optimal penalty coefficient (λ.min = 0.008) and to extract the nonzero coefficient genes. SVM-RFE, implemented using the e1071 and msvmRFE packages, After identifying 6 pivotal genes (MAP7D2, AR, DNAH6, CXorf36, ORM1, IQGAP3), logistic regression analysis was conducted to construct a nomogram model, employing the “rms” R package. The diagnostic efficacy of these 6 hub genes was appraised by plotting the ROC curve, utilizing the “ ROCR” R package.', '{0.22028234601020813,-0.24159349501132965,0.19979839026927948,0.18556705117225647,-0.22790037095546722,-0.39263325929641724,-1.1553105115890503,-0.5877730250358582,-0.24877774715423584,0.029466360807418823,-0.41878432035446167,0.07303827255964279,0.4598597288131714,0.056253064423799515,-0.4876948297023773,0.6536586284637451,0.7865063548088074,0.2560751736164093,-0.05092005059123039,0.39811068773269653,0.21882423758506775,-0.4477897584438324,-0.19539976119995117,-0.42305999994277954,-0.12210211157798767,-0.028255445882678032,0.6369739770889282,0.1459934562444687,0.33768847584724426,0.170135036110878,0.05208777263760567,0.18088209629058838,-0.19633716344833374,0.31715959310531616,-0.3000909686088562,-0.10845265537500381,-0.2909195125102997,0.25042441487312317,-0.7501404881477356,-0.24097095429897308,-0.005663889925926924,-0.2282692790031433,0.20793244242668152,-1.0132646560668945,-0.1608521193265915,0.18532440066337585,-0.37484532594680786,-0.35306280851364136,0.29050299525260925,-0.7762740850448608,-0.4891359806060791,-0.015296532772481441,-0.14691753685474396,-0.37724044919013977,0