VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 21, 's together, using IVW method. Horizontal lines represent 95% confidence intervals. (C) Scatter plot. The slope of each line denotes the estimated effect of per Mendelian randomization method. (D) Funnel plot. Vertical lines represent estimates with all SNPs. Symmetry in the funnel plot demonstrates no obvious horizontal pleiotropy. IVW = inverse-variance weighted, MR = Mendelian randomization, RA = rheumatoid arthritis, SNP = single nucleotide polymorphism. Our findings underscore the importance of sex-specific genetic factors in the pathogenesis of RA, an autoimmune disorder with complex and incompletely understood mechanisms. While previous studies have identified various genes associated with RA, the role of sex-based genetic variations has not been comprehensively explored.', '{0.5447933077812195,-0.2988293766975403,0.5850846171379089,-0.1104600802063942,-0.11513695120811462,-0.36560431122779846,0.3546067476272583,0.26283618807792664,-0.32188403606414795,-0.23914559185504913,-0.27086368203163147,-0.019957197830080986,0.10458196699619293,-0.15577630698680878,-0.00042641584877856076,0.4953886568546295,0.8348888158798218,0.3812814950942993,0.4850906431674957,0.4701041877269745,-0.28713658452033997,-0.2831464111804962,-0.6333512663841248,0.23984873294830322,-0.01652720384299755,-0.48249849677085876,-0.2924662232398987,0.2571757435798645,0.15477579832077026,0.2629722058773041,0.48418909311294556,0.6326645016670227,-0.2316296100616455,-0.829173743724823,-0.0664600059390068,0.2915199100971222,-0.33964380621910095,0.5655304193496704,0.22845372557640076,-0.5161817073822021,-0.06324362009763718,-0.04470134526491165,0.1968017965555191,-0.5459771752357483,-0.05114518851041794,-0.37460607290267944,0.10821203142404556,-0.3020555078983307,-0.8375251293182373,0.16962286829948425,0.31314486265182495,-0.3223702609539032,0.04463338479399681,-0.776131272315979,0.6113659143447876,-0.2289661169052124,0.153964295