VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 24, 'iveness, results showed that the model achieved an AUC of 0.956 in the training set and an AUC of 0.859 in the validation set ( We developed a ceRNA network using 5 diagnostic markers to investigate their regulatory mechanisms, highlighting miRNAs as key epigenetic regulators in RA. The pathways XIST-hsa-miR-124-3p and others may regulate disease progression. In RA, female synovial cells likely transform into fibroblast-like synoviocytes and osteoclasts via LNC-XIST-mediated miRNA modulation, Our MR analysis of 30 DEGs identified RETN as the only gene significantly linked to seronegative RA, showing a significant association ( Our findings highlight the significant role of RETN gene expression in increasing RA risk, particularly among seronegative and female patients. Elevated RETN expression notably heightens RA risk in females, suggesting distinct mechanisms by which RETN influences RA development across genders.', '{0.6453537344932556,-0.2645517885684967,0.7477186322212219,-0.21006323397159576,-0.4540618062019348,-0.48067769408226013,-0.8491502404212952,0.37313392758369446,-0.39933231472969055,-0.12215929478406906,-0.22621406614780426,0.4694826900959015,0.4791288673877716,0.12966151535511017,0.575584352016449,0.2541236877441406,0.24638938903808594,-0.7192752957344055,-9.635395690565929e-05,-0.23308397829532623,-0.30895769596099854,-0.3798384666442871,-0.07414216548204422,-0.012633335776627064,-0.28323546051979065,-0.984038770198822,-0.2030434012413025,0.5736083388328552,0.37976568937301636,0.30971667170524597,0.3220672011375427,0.4572870433330536,0.03462139517068863,-0.27960750460624695,-0.19090475142002106,-0.31349408626556396,-0.11333604156970978,0.7537427544593811,-1.3135360479354858,-0.16713015735149384,0.8249883651733398,-0.2094140499830246,0.5655076503753662,-0.24684247374534607,-0.5860100984573364,0.6612191796302795,0.16320936381816864,-0.43397200107574463,-1.113460659980774,-0.087036