VALUES ('Anti-CASPR2 meningoencephalitis with thickened dura mater induced by various infections: A case report and literature review', 'With the update of novel autoantibodies and the expansion of the clinical spectrum, our understanding of autoimmune encephalitis (AE) is rapidly evolving. Anti-CASPR2 meningoencephalitis is a relatively rare condition that may be induced by infections. A young man presented with 3 episodes of meningoencephalitis potentially triggered by possible viral,  Across all 3 episodes, similar clinical manifestations and imaging features were observed. Although autoantibodies in the previous 2 phases were negative, the possibility of infection-related anti-CASPR2 meningoencephalitis remains highly suspected. The treatment regimen comprised antimicrobial agents, corticosteroid therapy, intravenous immunoglobulin, and rituximab administration. Following treatment, the patient’s condition improved with no recurrence to date. Repeat testing showed undetectable anti-CASPR2 immunoglobulin G in both serum and cerebrospinal fluid. Post-treatment contrast-enhanced magnetic resonance imaging demonstrated the resolution of dural thickening. We further reviewed the mechanism of various infection-related AE and characteristics of CASPR2-related disease. To our knowledge, this is the first report of CASPR2 meningoencephalitis with thickened dura mater, indicating the importance of paying attention to antibody-negative AE and monitor antibodies repeatedly when necessary. In addition to immunotherapy, we recommend comprehensive management throughout the disease process. In recent years, antibody-positive autoimmune encephalitis (AE) has gradually gained public attention. With the update of novel autoantibodies and the expansion of the clinical spectrum, our understanding of AE is rapidly evolving. AE may be related to a variety of infections, including bacteria and viruses such as severe acute respiratory syndrome coronavirus 2 (SARS-CoV-2). Anti-CASPR2 meningoencephalitis is a relatively rare condition that can be similarly induced by infections. Different treatment strategies have been applied for CASPR2 encephalitis including steroids, intravenous immunoglobulin (IVIG), plasma exchange, azathioprine, cyclophosphamide, and/or rituximab. Herein, we detail a case of anti-CASPR2 meningoencephalitis with thickening of the cerebral dura mater, induced by several infections that have not previously been reported. In mid-October 2020, an 18-year-old male presented with bilateral lower extremity muscle soreness following military training. Four days later, he developed psychiatric symptoms, including irrelevant answers, gibberish speech, irritability, and sleep disturbances. He denied any relevant medical, medication, epidemiological, or prodromal infection history, and further denied a history of tobacco and alcohol consumption. On admission, his body temperature was 37.5 °C, and his blood pressure, heart rate, and respiratory rate were normal. Neurological examination revealed a weakened tendon reflex in the right upper extremity and a probable positive Kernig sign. No other abnormalities were observed. Coronavirus disease-2019 (COVID-19) nucleic acid test results were negative. Routine blood tests, liver and renal function, electrolytes, procalcitonin level, C-reactive protein, erythrocyte sedimentation rate, and coagulation function were all within the normal ranges. Serum immunity indices revealed an increase in serum immunoglobulin G (IgG) at 32.2 g/L, whereas the remaining indices were normal, including immunoglobulin A, immunoglobulin M (IgM), complement C3, complement C4, IgG4, antinuclear antibody spectrum, cytoplasmic antineutrophil cytoplasmic antibody, perinuclear antineutrophil cytoplasmic antibody, myeloperoxidase, neutrophil proteinase 3, and rheumatoid factor. Tumour marker tests, including alpha-fetoprotein, carcinoma embryonic antigen, carcinoma antigen 125, carcinoma antigen 199, cytokeratin fragment 21-1, neuron-specific enolase, and prostate-specific antigen were within the normal ranges. Myocardial enzyme tests revealed an increased lactate dehydrogenase level of 5302 U/L, increased aspartate aminotransferase level of 843 U/L, increased creatine kinase level of 39,875 U/L, and increased myoglobin level of 684.6 ng/mL. A thyroid autoantibody test revealed an increase in thyroid globulin antibody of 98.92 IU/mL. The lymphocyte subset test revealed an increase in CD3‐/CD19+ (B cells) at 21.42% concurrent with a decrease in CD3‐/CD16+ 56 + Abs (js3/16 + 56) at 125.38 cells/μL. The cerebrospinal fluid (CSF) pressure was normal. Routine and biochemistry CSF tests were within normal ranges. Tests for the Japanese encephalitis antibody, Cryptococcus neoformans capsular antigen, and microbial DNA sequencing in CSF all also showed no abnormalities. Oligoclonal bands, AE antibodies (NMDAR, AMPAR1, AMPAR2, LGI1, CASPR2, and CABABR), and demyelinating antibodies (AQP4, MBP, MOG, and GFAP) in the serum and CSF were all negative. The results of electrocardiogram, chest CT, abdominal ultrasound, urinary ultrasound, and echocardiography results were normal. Brain magnetic resonance imaging (MRI) revealed bilateral thickening of the dura mater, particularly on the left side (Fig.  (A–D) In phase I, enhanced brain MRI revealed thickening of the bilateral dura mater, particularly on the left side. (E–H) In phase I, enhanced brain MRI revealed a slight improvement in the lesion of the dura mater during the process of immunotherapy. (I–L) In phase II, enhanced brain MRI revealed that thickening of dura mater was relieved after approximately 1 month of comprehensive treatment. The results of evaluation were as follows: the patient presented with limbic encephalitis characterized by psychiatric symptoms, sleep disturbances, and a low fever, indicating an inflammatory response. Suspicious positive signs of meningeal irritation and thickening of the dura mater suggested meningeal involvement. Accordingly, the patient was diagnosed with autoimmune meningoencephalitis, potentially induced by a viral infection. Following admission, the patient was treated with acyclovir, olanzapine, phenobarbital, and venous fluid replacement. After the diagnosis was clarified, impulsion therapy of IVIG (0.4 g/kg/d*5d) and methylprednisolone (1g/d*3d, 500 mg/d*2d, 250 mg/d*1d) were administered. Reexamination of the brain MRI in early November 2020 revealed a slight improvement in the lesion of the dura mater during immunotherapy (Fig.  Following discharge, the patient experienced a marked increase in fatigue, loss of emotions, and crying, accompanied by a low fever. The patient was subsequently readmitted to our hospital. The results of the COVID-19 nucleic acid test were still negative. Routine blood tests revealed an increase in white blood cell and neutrophil counts. Widal and Weil Felix tests revealed a positive Salmonella typhi O antibody titer of 1:160 and a positive Salmonella paratyphoid C antibody titer of 1:320. The serum galactomannan test revealed an increase in Aspergillus antigen at 0.61 (0.00–0.49) and the serum (1,3)-β-D-glucan test revealed an increase in fungal (1–3)-β-D-glucan at 210.4 pg/mL (<60 pg/mL). Quantitative determination of endotoxin levels and blood cultures revealed no significant abnormalities. The CSF pressure was normal. The CSF routine and biochemistry test, oligoclonal bands test, serum IgG4, serum and CSF AE antibodies (DPPX, IgLON5, GABAARα1, GABAARβ3, GlyRα1, mGluR5, D2R, Neurexin3α, GAD65), serum and CSF paraneoplastic syndrome antibodies (Hu, Yo, Ri, CV2, Ma2, Amphiphysin, Mal, SOX1, Tr/DNER, Zic4, GAD65, PKCγ, Recoverin, Titin), and CSF microbial RNA sequencing were all normal. Ultrasonography of the bilateral inguinal, neck, and axillary regions revealed bilateral cervical lymph node enlargement, indicating possible reactive hyperplasia, with no significant abnormal enlargement of the lymph nodes in the bilateral axilla and groin areas. Following lumbar puncture, the patient received IVIG (0.4 g/kg*5d) and methylprednisolone (60 mg/d). Considering the possibility of paratyphoid fever and fungal infection, levofloxacin and fluconazole were administered, while methylprednisolone was reduced to 30 mg/day for continued immune regulation treatment. In early December 2020, enhanced brain MRI revealed no bilateral thickening of the dura mater (Fig.  The patient again presented with a fever in late December 2022, with a maximum body temperature of 38 °C, and COVID-19 nucleic acid detection was positive. The patient ultimately developed sleep disorders 2 days later and psychiatric symptoms 6 days later. Physical examination revealed horizontal nystagmus to the left in both eyes with no other abnormalities. C-reactive protein and free thyroxine levels were slightly elevated. Serum cytokines tests further revealed an increase of interleukin (IL)-17 at 39.1 pg/mL (≤19 pg/mL). Routine and biochemical blood tests, Widal test, Weil–Felix test, and immunity indices (immunoglobulin A, IgG, IgM, complement C3, complement C4, IgG4, cytoplasmic antineutrophil cytoplasmic antibody, perinuclear antineutrophil cytoplasmic antibody, antinuclear antibody spectrum, myeloperoxidase, neutrophil proteinase 3, and anti-glomerular basement antibody) showed no other abnormal findings. CSF pressure, routine CSF tests, biochemical tests, CSF cryptococcal capsular antigen levels, and oligoclonal bands were all normal. On December 27, 2022 testing for serum and CSF AE antibodies (NMDAR, AMPAR1, AMPAR2, LGI1, CASPR2, CABABR, DPPX, IgLON5, GABAARα1, GABAARβ3, GlyRα1, mGluR5, D2R, Neurexin3α, GAD65) and ganglioside antibodies (GM1, GM2, GM3, GM4, GD1a, GD1b, GD2, GD3, GT1a, GT1b, GQ1b, sulfatide) were planned. All tests for CSF antibodies were negative. Serum anti-GT1a antibody IgG and serum anti-CASPR2 antibody IgG were positive at a titer of 1:10 (Fig.  (A) The patient CSF immunofluorescence staining (TBA) at 4× magnification. (B) The patient CSF immunofluorescence staining (TBA) at 20× magnification showed vascular-like abnormal signal. (C) The patient CSF Caspr2 staining (CBA) was negative. (D) The patient serum Caspr2 staining (CBA) was positive at a dilution of 1:10. (A–D) In phase III, PET-CT of the brain revealed that the dura mater of the left frontal part was slightly thicker, metabolism was normal, and there were no obvious abnormalities in the brain parenchyma. (E–H) In phase III, the left dura mater was strengthened and thicker than the contralateral region in the enhanced brain MRI. (I–L) In phase III, the enhanced brain MRI showed that thickening of the dura mater was relieved after over 1 month of comprehensive treatment. PET-CT = positron emission tomography-computed tomography. The case summary was as follows: the patient had no manifestations of cranial nerve involvement or sensory disturbances, indicating that the anti-GT1a antibody was not responsible for the symptoms. Based on the above clinical manifestations, the positive serum CASPR2 antibodies, and thickening of the dura mater, the patient was diagnosed with CASPR2-related autoimmune encephalomeningitis. During his hospitalization, methylprednisolone (500 mg/d*3d) and IVIG (0.4 g/kg*5d) were administrated. Ganciclovir, levofloxacin, and ceftriaxone were further administered for anti-infection therapy. In early January 2023, rituximab (640 mg) was intravenously administered. The patient’s symptoms substantially improved. Reexamination of serum and CSF anti-CASPR2 antibody IgG levels were negative. Following discharge, the patient continued to receive oral methylprednisolone (40 mg/day) as maintenance therapy. Repeat brain MRI scan in February (Fig.  In June 2023, the young man again presented with obsessive-compulsive symptoms, such as repacking clothes for a short time after a long journey. During hospitalization in July 2023, routine CSF, biochemical, cytokine, oligoclonal bands, anti-CASPR2 antibody, both in the serum and CSF, were reexamined, and brain MRI was performed. No apparent abnormalities were observed. The patient was treated with intravenous rituximab (600 mg) therapy in July 2023 (Fig.  The clinical course of our case. As mentioned above, in phase I, the patient manifested with low fever, limbic encephalitis, probable meningeal irritation signs, and thickened dura mater. Antiviral therapies and immunotherapies were effective at this stage. Although the results of pathogenic assays and autoimmunity-related antibodies were negative, viral infection-induced autoimmune meningoencephalitis was diagnosed. However, the patient presented with a low fever and limbic encephalitis in phase II. Laboratory tests indicated paratyphoid fever and fungal infection, whereas autoimmunity-related antibodies in both serum and CSF were negative. The patient was diagnosed with Salmonella infection-induced AE. Following anti-infective therapy and immunotherapy, his symptoms improved, the titers of the Widal and Weil Felix tests decreased, and no thickening of the dura mater was observed. In phase III, the patient was readmitted with fever, SARS-CoV-2 infection, limbic encephalitis, and thickening of the left dura mater. The serum anti-CASPR2 antibody IgG test results were positive. The patient was subsequently diagnosed with CASPR2-related autoimmune meningoencephalitis. Reviewing the 3 phases, similar clinical manifestations and imaging characteristics were observed. Although autoantibodies in the previous 2 phases were negative, the possibility of infection-related anti-CASPR2 meningoencephalitis remains highly suspected. These 3 episodes of encephalitis were mediated by possible viral, Salmonella, and SARS-CoV-2 infection. This case indicates the importance of paying attention to antibody-negative AE and monitoring antibodies repeatedly when necessary, as the results of antibodies may be negative in the early stages. The findings of previous studies have shown that the pathogenesis of AE may include disease triggers (infections), predisposing factors (human leukocyte antigen), and an interplay between these 2 factors. To date, no cases of AE induced by Salmonella or other enterobacteria have been reported. Noninfectious neurological complications of typhoid fever include encephalopathy, neuropsychiatric disorders, cerebral edema, cerebellar ataxia, Parkinsonism, acute disseminated encephalomyelitis, and brainstem encephalitis. Immune-mediated processes and endotoxaemia have been proposed as possible underlying mechanisms. It has been clearly shown that SARS-CoV-2 mainly attacks the respiratory system, causing mild to severe respiratory diseases. However, this virus also affects the nervous system, and can potentially exhibit neurotropic and neuroinvasive properties. CASPR2 is a cell adhesion molecule belonging to the neurexin IV superfamily. CASPR2 is encoded by the contactin-associated protein-like 2 gene on chromosome 7q35. CASPR2 is located in the limbic system, basal ganglia, neurones of other motor areas, and sensory pathways, and is particularly abundant in the temporal lobe. The most common MRI findings have been found to be T2 hyperintensities in the medial temporal lobe, followed by hippocampal atrophy, middle temporal gyrus sclerosis, and hippocampal sclerosis. The most common FDG-PET finding is hypometabolism in the temporal lobe. Based on the consensus regarding the diagnosis and treatment of AE, This is the first report of CASPR2 meningoencephalitis with thickened dura mater which was mediated by possible viral, Salmonella, and SARS-CoV-2 infection, reminding clinicians that the possibility of CASPR2 meningoencephalitis should also be considered when imaging only reveals thickening of the dura mater, also indicating the importance of paying attention to antibody-negative AE and monitoring antibodies repeatedly when necessary when the results of antibodies may be negative in the early stages. In addition to immunotherapy, one of the crucial measures for managing CASPR2-related AE or meningoencephalitis is the prevention of infections caused by viral, bacterial, and other rare pathogens. During immunosuppressive therapy to prevent disease recurrence and progression, some patients may develop opportunistic infections that can worsen their condition. We recommend comprehensive management throughout the disease process, dynamic monitoring of immune indicators such as IgG, IgM, and B lymphocytes, and advising patients to maintain a regular schedule and appropriate exercise, all of which may improve the disease.', 'PubMed_Central', 'sleep_disorders', 'https://www.ncbi.nlm.nih.gov/pmc/', 'research_article', '{"content_hash": "35a9151b0792dc10", "embedding_date": "2025-06-25T14:49:34.872628", "scraper_source": "PubMed_Central", "category": "research_literature", "subcategory": "pubmed_central", "document_type": "research_article", "published_date": "", "original_url": "https://www.ncbi.nlm.nih.gov/pmc/"}', 16455);

