VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'peat testing showed undetectable anti-CASPR2 immunoglobulin G in both serum and cerebrospinal fluid. Post-treatment contrast-enhanced magnetic resonance imaging demonstrated the resolution of dural thickening. We further reviewed the mechanism of various infection-related AE and characteristics of CASPR2-related disease. To our knowledge, this is the first report of CASPR2 meningoencephalitis with thickened dura mater, indicating the importance of paying attention to antibody-negative AE and monitor antibodies repeatedly when necessary. In addition to immunotherapy, we recommend comprehensive management throughout the disease process. In recent years, antibody-positive autoimmune encephalitis (AE) has gradually gained public attention. With the update of novel autoantibodies and the expansion of the clinical spectrum, our understanding of AE is rapidly evolving.', '{0.32180216908454895,-0.38700470328330994,0.5683957934379578,-0.5905995965003967,-0.2653399407863617,0.30717000365257263,0.23702368140220642,-0.1087760180234909,-0.04614504799246788,-0.05400458723306656,-0.15187804400920868,0.716737687587738,1.1041141748428345,0.4832789897918701,0.44987255334854126,0.6554499268531799,-1.251373529434204,-0.29712244868278503,-0.2014695256948471,0.06342523545026779,-0.8428841829299927,-0.07935359328985214,0.20467562973499298,-0.13424067199230194,-0.2906542420387268,-0.10172441601753235,0.43370577692985535,-0.10399714857339859,-0.6308455467224121,-0.15090994536876678,-0.16525070369243622,-0.05286629870533943,-0.05140778049826622,0.09542486071586609,-0.47173798084259033,-0.44399064779281616,0.7934799194335938,-0.012686100788414478,0.0683981329202652,-0.30454564094543457,0.2272692769765854,-0.3224523365497589,0.4058668315410614,0.26490873098373413,0.2343796342611313,0.996313750743866,-0.4050317108631134,0.32257118821144104,0.14668504893779755,-0.07545485347509384,0.6498586535453796,-0.4037418067455292,-0.02