VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'oantibodies and the expansion of the clinical spectrum, our understanding of AE is rapidly evolving. AE may be related to a variety of infections, including bacteria and viruses such as severe acute respiratory syndrome coronavirus 2 (SARS-CoV-2). Anti-CASPR2 meningoencephalitis is a relatively rare condition that can be similarly induced by infections. Different treatment strategies have been applied for CASPR2 encephalitis including steroids, intravenous immunoglobulin (IVIG), plasma exchange, azathioprine, cyclophosphamide, and/or rituximab. Herein, we detail a case of anti-CASPR2 meningoencephalitis with thickening of the cerebral dura mater, induced by several infections that have not previously been reported. In mid-October 2020, an 18-year-old male presented with bilateral lower extremity muscle soreness following military training. Four days later, he developed psychiatric symptoms, including irrelevant answers, gibberish speech, irritability, and sleep disturbances.', '{0.27638065814971924,-0.15337605774402618,0.7533079981803894,-0.7271215915679932,-0.18122664093971252,0.24010412395000458,-0.3454802930355072,-0.00934235006570816,-0.24699275195598602,-0.30500802397727966,7.556084165116772e-05,0.8192111849784851,0.6337318420410156,0.34872502088546753,0.19635997712612152,0.5908025503158569,-1.4269448518753052,-0.2865728735923767,-0.09628063440322876,-0.09629008919000626,-0.581139087677002,-0.16597343981266022,0.16423040628433228,-0.039247676730155945,-0.37357276678085327,0.3530118465423584,0.41166871786117554,-0.26728513836860657,-0.5074633359909058,0.34068727493286133,-0.495892196893692,-0.26262104511260986,-0.05851908400654793,0.38543909788131714,-0.22417894005775452,-0.6422305703163147,0.4552110433578491,-0.1405734121799469,-0.6215664744377136,-0.17367902398109436,0.2600468397140503,-0.6990562677383423,0.1437881588935852,0.3901030719280243,-0.33486127853393555,0.4041158854961395,-0.2150