VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 7, 'patient was diagnosed with autoimmune meningoencephalitis, potentially induced by a viral infection. Following admission, the patient was treated with acyclovir, olanzapine, phenobarbital, and venous fluid replacement. After the diagnosis was clarified, impulsion therapy of IVIG (0.4 g/kg/d*5d) and methylprednisolone (1g/d*3d, 500 mg/d*2d, 250 mg/d*1d) were administered. Reexamination of the brain MRI in early November 2020 revealed a slight improvement in the lesion of the dura mater during immunotherapy (Fig.  Following discharge, the patient experienced a marked increase in fatigue, loss of emotions, and crying, accompanied by a low fever. The patient was subsequently readmitted to our hospital. The results of the COVID-19 nucleic acid test were still negative. Routine blood tests revealed an increase in white blood cell and neutrophil counts.', '{0.18435469269752502,-0.3620903789997101,0.47524142265319824,-0.6771578192710876,0.01284937746822834,0.8463640809059143,-0.4299761950969696,-0.35043853521347046,-0.4610026180744171,-0.34921225905418396,-0.21324819326400757,0.4516282081604004,0.35908177495002747,0.11058309674263,0.4279284179210663,0.9191804528236389,-0.14084641635417938,-0.14856694638729095,-0.004773247055709362,0.03349948301911354,-0.43019211292266846,-0.44345909357070923,0.09230365604162216,-0.3148522973060608,0.02259782701730728,0.23025639355182648,0.6092395186424255,-0.28354182839393616,-0.3044089376926422,0.4733174741268158,-0.5382360816001892,-0.021728528663516045,-0.2476927936077118,0.6852832436561584,-0.6040164232254028,-0.2803395986557007,0.5962300896644592,-0.35555073618888855,-1.1241415739059448,-0.16437585651874542,-0.48352348804473877,0.015527261421084404,-0.20956499874591827,0.41114115715026855,0.0987396314740181,0.46764788031578064,-0.7249242067337036,0.20164017379283905,-0.8111239671707153,0.03788558021187782,0.7263251543045044,-0.16326406598091125,-0.6777966618537903,