VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'r sensory disturbances, indicating that the anti-GT1a antibody was not responsible for the symptoms. Based on the above clinical manifestations, the positive serum CASPR2 antibodies, and thickening of the dura mater, the patient was diagnosed with CASPR2-related autoimmune encephalomeningitis. During his hospitalization, methylprednisolone (500 mg/d*3d) and IVIG (0.4 g/kg*5d) were administrated. Ganciclovir, levofloxacin, and ceftriaxone were further administered for anti-infection therapy. In early January 2023, rituximab (640 mg) was intravenously administered. The patient’s symptoms substantially improved. Reexamination of serum and CSF anti-CASPR2 antibody IgG levels were negative. Following discharge, the patient continued to receive oral methylprednisolone (40 mg/day) as maintenance therapy. Repeat brain MRI scan in February (Fig.  In June 2023, the young man again presented with obsessive-compulsive symptoms, such as repacking clothes for a short time after a long journey.', '{0.6202805638313293,-0.28588971495628357,0.467043399810791,-0.5333417654037476,-0.02735081873834133,0.6976275444030762,0.22891399264335632,-0.05660879239439964,-0.45270341634750366,-0.0666884109377861,-0.1440027356147766,0.4833748936653137,0.7969151735305786,0.0922853872179985,0.9153344631195068,0.6785511374473572,-1.2948821783065796,-0.37726715207099915,0.25901198387145996,-0.1665698140859604,-0.6650307178497314,0.16467957198619843,0.3659437298774719,0.05674935132265091,-0.10558108985424042,0.35770726203918457,0.6345561146736145,-0.32372522354125977,-0.33893194794654846,0.4241497218608856,-0.6082426309585571,0.5810074806213379,-0.27926644682884216,0.7969198226928711,-0.6165906190872192,-0.24970164895057678,0.7787332534790039,0.05158208683133125,-0.32912713289260864,-0.2190881073474884,-0.17195598781108856,-0.11691683530807495,-0.15131589770317078,0.4641583263874054,-0.3472513258457184,0.7620721459388733,-0.37021073