VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'was diagnosed. However, the patient presented with a low fever and limbic encephalitis in phase II. Laboratory tests indicated paratyphoid fever and fungal infection, whereas autoimmunity-related antibodies in both serum and CSF were negative. The patient was diagnosed with Salmonella infection-induced AE. Following anti-infective therapy and immunotherapy, his symptoms improved, the titers of the Widal and Weil Felix tests decreased, and no thickening of the dura mater was observed. In phase III, the patient was readmitted with fever, SARS-CoV-2 infection, limbic encephalitis, and thickening of the left dura mater. The serum anti-CASPR2 antibody IgG test results were positive. The patient was subsequently diagnosed with CASPR2-related autoimmune meningoencephalitis. Reviewing the 3 phases, similar clinical manifestations and imaging characteristics were observed.', '{0.47721007466316223,-0.33254873752593994,0.9030582904815674,-0.8385580778121948,-0.007948013022542,0.7430475950241089,-0.26729536056518555,-0.1541711688041687,0.0622338205575943,-0.057463809847831726,-0.18271765112876892,0.4125237464904785,0.42814189195632935,0.11493358016014099,0.6596358418464661,0.8948463797569275,-1.1023905277252197,-0.5182278156280518,-0.016288727521896362,-0.004369672387838364,-0.3581957519054413,-0.29270437359809875,0.38621512055397034,-0.07966810464859009,-0.47705385088920593,0.40766143798828125,0.6791836619377136,-0.3122040927410126,-0.3343883752822876,0.4334802031517029,-0.09524904191493988,0.009791990742087364,-0.2535204291343689,0.484100341796875,-0.4843202829360962,-0.32413381338119507,0.2629528045654297,0.0025206084828823805,-0.7216039299964905,-0.3829778730869293,0.301747590303421,-0.6412956714630127,0.23146161437034607,0.2964584529399872,0.23866476118564606,0.26680848002433777,-0.4088965952396393,0.46425628662109375,-0.23062628507614136,-0.12726591527462006,1.0439109802246094,0.04514098912477493,-0.