VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, '. Reviewing the 3 phases, similar clinical manifestations and imaging characteristics were observed. Although autoantibodies in the previous 2 phases were negative, the possibility of infection-related anti-CASPR2 meningoencephalitis remains highly suspected. These 3 episodes of encephalitis were mediated by possible viral, Salmonella, and SARS-CoV-2 infection. This case indicates the importance of paying attention to antibody-negative AE and monitoring antibodies repeatedly when necessary, as the results of antibodies may be negative in the early stages. The findings of previous studies have shown that the pathogenesis of AE may include disease triggers (infections), predisposing factors (human leukocyte antigen), and an interplay between these 2 factors. To date, no cases of AE induced by Salmonella or other enterobacteria have been reported.', '{0.1223812848329544,-0.38501036167144775,0.4970569610595703,-0.2582946717739105,-0.23630934953689575,0.5400029420852661,-0.4365808069705963,0.06173468753695488,-0.0038648624904453754,-0.0751807913184166,-0.27205225825309753,0.3204934000968933,0.4858724772930145,0.0698198527097702,-0.0648619756102562,0.42731085419654846,-0.966749906539917,-0.24531765282154083,0.19754475355148315,-0.0889153704047203,-0.27383577823638916,-0.6800522208213806,-0.07149608433246613,-0.3401898443698883,-0.7736403942108154,0.47115060687065125,0.4858970046043396,-0.3948439359664917,-0.14627204835414886,-0.11761784553527832,-0.13053062558174133,-0.2199515849351883,-0.09154324978590012,0.00703852204605937,-0.19531796872615814,-0.42471855878829956,0.21027569472789764,0.2279532551765442,-0.7036594748497009,-0.7014925479888916,-0.059767935425043106,-0.7033709287643433,0.7038066387176514,-0.05851665139198303,-0.023853275924921036,0.5334798693656921,-0.021414663642644882,0.4166717231273651,-0.30653348565101624,-0.2998815178871155,0.6682748198509216,0.0024736912455409765,-0.12119064480