VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 17, '2 factors. To date, no cases of AE induced by Salmonella or other enterobacteria have been reported. Noninfectious neurological complications of typhoid fever include encephalopathy, neuropsychiatric disorders, cerebral edema, cerebellar ataxia, Parkinsonism, acute disseminated encephalomyelitis, and brainstem encephalitis. Immune-mediated processes and endotoxaemia have been proposed as possible underlying mechanisms. It has been clearly shown that SARS-CoV-2 mainly attacks the respiratory system, causing mild to severe respiratory diseases. However, this virus also affects the nervous system, and can potentially exhibit neurotropic and neuroinvasive properties. CASPR2 is a cell adhesion molecule belonging to the neurexin IV superfamily. CASPR2 is encoded by the contactin-associated protein-like 2 gene on chromosome 7q35. CASPR2 is located in the limbic system, basal ganglia, neurones of other motor areas, and sensory pathways, and is particularly abundant in the temporal lobe.', '{0.039721619337797165,-0.5203500986099243,0.7092648148536682,-0.6486485004425049,0.18548911809921265,0.2778819799423218,-0.41772618889808655,-0.25778982043266296,-0.46520984172821045,-0.10406298190355301,-0.12648256123065948,-0.027179032564163208,0.1227964535355568,-0.34441834688186646,-0.018530799075961113,-0.09442237764596939,-0.6621503829956055,-0.10501649230718613,0.6143328547477722,-0.38553348183631897,-0.4279272258281708,-0.05928916856646538,-0.3640529215335846,-0.22578682005405426,-0.015878522768616676,0.10391984134912491,-0.23859331011772156,-0.32579877972602844,0.10823695361614227,0.478786826133728,-0.19525371491909027,-0.4406411647796631,-0.14159150421619415,0.1103893592953682,-0.4751420319080353,-0.2081737220287323,-0.25782570242881775,0.5291610956192017,-1.5506130456924438,-0.7329814434051514,0.5776248574256897,-1.183552861213684,0.5760763883590698,-0.24271170794963837,-0.05673763155937195,0.0638973414897