VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 18, 'rones of other motor areas, and sensory pathways, and is particularly abundant in the temporal lobe. The most common MRI findings have been found to be T2 hyperintensities in the medial temporal lobe, followed by hippocampal atrophy, middle temporal gyrus sclerosis, and hippocampal sclerosis. The most common FDG-PET finding is hypometabolism in the temporal lobe. Based on the consensus regarding the diagnosis and treatment of AE, This is the first report of CASPR2 meningoencephalitis with thickened dura mater which was mediated by possible viral, Salmonella, and SARS-CoV-2 infection, reminding clinicians that the possibility of CASPR2 meningoencephalitis should also be considered when imaging only reveals thickening of the dura mater, also indicating the importance of paying attention to antibody-negative AE and monitoring antibodies repeatedly when necessary when the results of antibodies may be negative in the early stages.', '{0.24703402817249298,-0.24444492161273956,0.8220096230506897,-0.7273441553115845,-0.07448761910200119,0.28865525126457214,-0.2387041598558426,-0.5703968405723572,0.013709880411624908,-0.3195211589336395,-0.07122932374477386,0.6868388652801514,0.31537383794784546,0.6511157751083374,-0.17058609426021576,0.2599508464336395,-1.4538426399230957,-0.4931122362613678,0.14258553087711334,0.11327941715717316,-0.2891521155834198,0.0055653913877904415,0.27184203267097473,-0.1838233917951584,-0.17505347728729248,0.06556671857833862,0.3016585111618042,-0.16803902387619019,-0.8689247369766235,0.11751464009284973,-0.629119873046875,-0.2599138021469116,0.15139378607273102,0.26432356238365173,-0.7923145294189453,-0.5069131255149841,0.021166672930121422,-0.45212870836257935,-0.019026439636945724,-0.11029116064310074,0.170161634683609,-0.2517872154712677,0.3800618052482605,0.8504833579063416,-0.12184669077396393,0.8943819999694824,-0.31880655884742737,0.7592626214027405,-0.0273809321224689