VALUES ('Using Rasch analysis to assess the latent construct of the Capacity to Work Index in a Swedish working population sample', 'Measurements of capacity to work (CTW) in relation to common mental disorders (CMD) are needed to improve research on determinants for maintained work participation (WP). The aim of this study was to assess the construct validity of the Capacity to Work Index (C2WI) in a heterogenous sample of the Swedish working population. Cross-sectional web survey data among Swedish employees ( Common mental disorders (CMD) impact public health and work participation (WP) [ The generic Work Ability House model has four dimensions suggested to interact: health and functional capacities;

