INSERT INTO document_embeddings (document_id, chunk_index, chunk_content, embedding)
VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, '(C2WI) was developed to suit a working population and to contribute with details on how CTW varies. The C2WI was recently assessed in a field study [ The ‘Work Participation and Mental Health at Work’ project is part of the network ‘New Ways’—‘mental health at work’ aiming for scientific knowledge to promote WP and prevent sickness absence. This cross-sectional study utilized data from a web-based survey of employed individuals aged 18 years and older. There are no public registers of currently working employees in Sweden, so different recruitment procedures were used to obtain a large sample from heterogeneous work contexts. Initially, private sector employers and Swedish trade unions were contacted and provided with detailed information about the study. The recruitment of public sector employees was then conducted similarly. Employers who agreed to participate provided employees’ work emails.', '{-0.17282675206661224,-0.2784620225429535,0.003414899343624711,-0.34218937158584595,-0.5409484505653381,0.10510381311178207,-0.2738763093948364,0.25994187593460083,-0.4906271696090698,-0.036836713552474976,-0.22011807560920715,-0.8572909832000732,0.46304699778556824,-0.1387455314397812,-0.8302109241485596,-0.26874592900276184,0.3172452747821808,0.3310888409614563,-0.1325911432504654,-0.26627159118652344,-0.24782080948352814,-0.0028305966407060623,-0.4018726944923401,-0.3913741111755371,0.22412167489528656,-0.20599748194217682,0.7543864846229553,-0.2604074776172638,0.17588043212890625,0.7818480134010315,-0.0761934444308281,-1.3944450616836548,-0.1660982370376587,0.45642006397247314,0.5983350872993469,0.4723623991012573,-0.04442455619573593,0.19849419593811035,-0.2516193389892578,-0.3453908860683441,-0.4267808198928833,-0.15092013776302338,-0.547349214553833,0.01949196308851242,-0.7205029726028442,0.1803293526172638,0.10094554722309113,-0.1656026542186737,1.0309196710586548,0.09132903069257736,0.02803161